<body>
  <div id="app">We are building somthing special for you ...</div>
  <script>
    window.$docsify = {
      search: 'auto', // default
      search : [
        '/',
      ],
      repo: 'https://github.com/Aicycle-Insurance',
      plugins: [
        function(hook) {
          var footer = [
            '<footer style="text-align: center;margin-top: 50px;">',
            '<span> Copyright Â© 2022 AICycle. All rights reserved.</span>',
            '</footer>'
          ].join('');

          hook.afterEach(function(html) {
            return html + footer;
          });
        }
      ],
      auto2top: true,
      executeScript: true,
      loadSidebar: true,
      <!-- loadNavbar: true, -->
      maxLevel: 4,
      subMaxLevel: 3,
      coverpage: true,
      name: 'AICycle Documentation',
      search: {
        noData: {
          '/': 'No results!'
        },
        paths: 'auto',
        placeholder: {
          '/': 'Search'
        }
      },
      formatUpdated: '{MM}/{DD} {HH}:{mm}',
      
    }
  </script>
